import './main.css'

function Main(){
    return(
        <div>
            <div>
                <h2>O que estamos fazendo para ajudar o seu negócio</h2>
                <p>Durante todo o período de quarentena, estamos à total disposição de cada um de vocês, clientes.O COVID-19 chegou desestabilizando o país e trazendo consigo uma grande incógnita quanto a proporção disso no país, nas pessoas e principalmente, na economia.</p>
                <p>Nosso compromisso com você durante essa fase, é para assegurar que o seu negócio seja o  menos afetado possível, mantendo sua base de clientes fidelizados sólida e segura!
                </p>
            </div>

            <div>

            </div>

            <div>

            </div>

            <div>

            </div>

        </div>
    );
}

export default Main;
